class Solution {
    public int minimumBoxes(int n) {
        int s = 0;
        int k = 0;
        int gap = 0;
        while (s < n) {
            gap++;
            k += gap;
            s += k;
        }
        if (s == n) {
            return k;
        }
        // 最底下一层我们不这么放了，撤掉
        s -= k;
        k -= gap;
        // 尝试别的放置方法：这是最难的地方，想清楚！
        int m = 0;
        while (s < n) {
            m++;
            s += m;
        }
        return k + m;
    }
}

